import React from "react";
import Link from "next/link";
import {Navbar, Nav, NavDropdown} from 'react-bootstrap'

export default function Navigations() {
 return (
  <div>
    <Navbar className="bg-nav" collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Link href="/" passHref><Navbar.Brand><img
        src="../images/batman.png"
        width="30"
        height="30"
        className="d-inline-block align-top"
        alt="React Bootstrap logo"
      /></Navbar.Brand></Link>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="ml-auto">
      <Link href="/Kurumsal" passHref><Nav.Link>Kurumsal</Nav.Link></Link>
      <Link href="/Hizmetlerimiz" passHref><Nav.Link>Hizmetlerimiz</Nav.Link></Link>
      <Link href="/Bolgelerimiz" passHref><Nav.Link>Bolgelerimiz</Nav.Link></Link>
      <Link href="/Iletisim" passHref><Nav.Link>İletişim</Nav.Link></Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
  </div>
 );
}

{/* <Link href="/"><a className="link-nav">Anasayfa</a></Link>
      <Link href="/hizmetlerimiz"><a className="link-nav">Hizmetlerimiz</a></Link> */}

